import React from "react";
import Picture from "./duncanIdaho.gif";

function DuncanIdaho () {
    return (
        <div>
            <img src={Picture} alt="Duncan Idaho" height="300" width="300"/>
        </div>
    );
}

export default DuncanIdaho;
